import './App.css';
import {
	Routes,
	Route
} from "react-router-dom";
import Navbar from './Components/Navbar';
import Register from './pages/Register';
import Login from './pages/Login';
import Tasks from './pages/Tasks';
import PrivateRoute from './utils/PrivateRoute';

function App() {
	return ( <
		div className = "App" >
		<
		Navbar / >

		<
		Routes >
		<
		Route path = "register/"
		element = {
			< Register / >
		}
		/> <
		Route path = "login/"
		element = {
			< Login / >
		}
		/>

		<
		Route path = "tasks/"
		element = {
			< Tasks / >
		}
		/>

		<
		/Routes>

		<
		/div>
	);
}

export default App;
